import React from 'react';

import './App.css';
import Page from './Page.js'
import Home from './Home.js'
import Sidebar from './Sidebar.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  useRouteMatch
} from "react-router-dom";
import photos from './Data/Data.js'

function App() {
  const photo = photos;
  return (

    <Router>
      <div className="App">

        <Switch>
          <Route exact path="/"><Home/></Route>
          <Route exact path="/thegoodfork" children={<Page blank="hello"/>} />
          {routes.map((route, index) => (
              // Render more <Route>s with the same paths as
              // above, but different components this time.
              <Route
                key={index}
                path={route.path}
                exact={route.exact}
                children={<Page 
                  name={this.props.hello}
                  relativeLocation={this.props.relativeLocation}
                  address={this.props.address}
                  commute={this.props.commute}
                  foodValue={this.props.foodValue}
                  blurb={this.props.blurb}
                />}
              />
            ))}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
